using System;
using System.Linq;
using System.Security.Cryptography;
using System.Text;

namespace CommonStructureLibraryUnitTests;

public static class TestingHelpers
{
            #region PostgresChars
        //This is a base64 encoded string of all the chars that don't error when inserted into the default Postgres server.
        const string CharData = "";
        public static char[] ValidPostgresChars = Encoding.UTF8.GetString(Convert.FromBase64String(CharData)).ToCharArray();
        #endregion
    static readonly RandomNumberGenerator RNG = RandomNumberGenerator.Create();
        public static byte[] RandomByteArray(byte length)
        {
            byte[] toReturn = new byte[length];
            RNG.GetBytes(toReturn);
            return toReturn;
        }
        public static T ReturnRandomValue<T>(params T[] input) => input[RandomNumberGenerator.GetInt32(input.Length)];
        public static T? Nullable<T>(T input) => default(T?) == null? ReturnRandomValue<T?>(input, default(T?)): throw new Exception("Something weird happened with nullable stuff.");
        public static Guid RandomGuid => new Guid(RandomByteArray(16));
        public static bool RandomBool => ReturnRandomValue<bool>(true, false);
        public static byte RandomByte => RandomByteArray(1)[0];
        public static char RandomChar => ReturnRandomValue<char>(ValidPostgresChars);

        public static short RandomShort => BitConverter.ToInt16(RandomByteArray(2));
        public static int RandomInt => BitConverter.ToInt32(RandomByteArray(4));
        public static long RandomLong => BitConverter.ToInt64(RandomByteArray(8));
        public static ulong RandomULong => BitConverter.ToUInt64(RandomByteArray(8));
        public static float RandomFloat => BitConverter.ToSingle(RandomByteArray(4));
        public static double RandomDouble => BitConverter.ToDouble(RandomByteArray(8));
        public static decimal RandomDecimal => new decimal(RandomInt, RandomInt, RandomInt, RandomBool, (byte)RandomNumberGenerator.GetInt32(29));
        public static string RandomString(byte length) => new string(Enumerable.Repeat('\0', length).Select((x) => RandomChar).ToArray());
        public static DateTime RandomDateTime
        {
            get
            {
                while (true)
                {
                    try
                    {
                        long ticks = RandomLong;
                        #warning Fix this so the CSL will handle this part.
                        ticks = ticks - (ticks % 10L);
                        return new DateTime(ticks);
                    }
                    catch{}//When the Long value is an invalid DateTime, we'll just try again. No. It's not efficient, but it IS much less code, and *will* generate a random DateTime
                }
            }
        }
        
        public static byte[] MaxByteArray(byte length) => Enumerable.Repeat(MaxByte, length).ToArray();
        public static Guid MaxGuid => new Guid(MaxByteArray(16));
        public static bool MaxBool => true;
        public static byte MaxByte => 0xFF;
        public static char MaxChar => char.MaxValue;
        public static short MaxShort => short.MaxValue;
        public static int MaxInt => int.MaxValue;
        public static long MaxLong => long.MaxValue;
        public static ulong MaxULong => ulong.MaxValue;
        public static float MaxFloat => float.MaxValue;
        public static double MaxDouble => double.MaxValue;
        public static decimal MaxDecimal => decimal.MaxValue;
        public static string MaxString => new string(MaxChar, MaxByte);
        #warning Revert after CSL supports handling Ticks
        //public static DateTime MaxDateTime => DateTime.MaxValue;
        public static DateTime MaxDateTime
        {
            get
            {
                long ticks = DateTime.MaxValue.Ticks;
                ticks = ticks - (ticks % 10L);
                return new DateTime(ticks);
            }
        }

        public static byte[] MinByteArray(byte length) => Enumerable.Repeat(MinByte, length).ToArray();
        public static Guid MinGuid => new Guid(MinByteArray(16));
        public static bool MinBool => false;
        public static byte MinByte => 0x00;
        //Postgres does not support null characters in strings...
        public static char MinChar => (char) 0x01;
        public static short MinShort => short.MinValue;
        public static int MinInt => int.MinValue;
        public static long MinLong => long.MinValue;
        public static ulong MinULong => ulong.MinValue;
        public static float MinFloat => float.MinValue;
        public static double MinDouble => double.MinValue;
        public static decimal MinDecimal => decimal.MinValue;
        public static string MinString => "";
        public static DateTime MinDateTime => DateTime.MinValue;

        //Postgres does not support null characters in strings...
        public static string AltMinString => new string(MinChar, MaxByte);
        //Special Floats
        public static float FInf => float.PositiveInfinity;
        public static float FNegInf => float.NegativeInfinity;
        public static float FEps => float.Epsilon;
        public static float FNaN => float.NaN;
        public static float Fi => (float)Math.Sqrt(-1);
        public static float FNegZero => -0.0f;
        //Special Doubles
        public static double DInf => double.PositiveInfinity;
        public static double DNegInf => double.NegativeInfinity;
        public static double DEps => double.Epsilon;
        public static double DNaN => double.NaN;
        public static double Di => Math.Sqrt(-1);
        public static double DNegZero => -0.0;
        //Special Decimals
        public static decimal DecNegZero => -0.0m;
}